/*Table structure for table `sys_param_bk` */

DROP TABLE IF EXISTS `sys_param_bk`;

CREATE TABLE `sys_param_bk` (
  `PARAM_ID` int(11) NOT NULL AUTO_INCREMENT,
  `PARAM_CODE` varchar(50) DEFAULT NULL,
  `PARAM_TYPE` varchar(50) DEFAULT NULL,
  `DESC_TH` varchar(200) DEFAULT NULL,
  `DESC_EN` varchar(200) DEFAULT NULL,
  `CREATE_BY` varchar(50) DEFAULT NULL,
  `CREATE_DATE` datetime DEFAULT NULL,
  `UPDATE_BY` varchar(50) DEFAULT NULL,
  `UPDATE_DATE` datetime DEFAULT NULL,
  `ACTIVE` varchar(1) DEFAULT 'Y',
  `SORT_NO` int(11) DEFAULT NULL,
  PRIMARY KEY (`PARAM_ID`)
) ENGINE=InnoDB AUTO_INCREMENT=818 DEFAULT CHARSET=utf8;

